import React from "react";
import styled from "styled-components";

const FoodList = ({ currentPlace, list }) => {
  console.log(currentPlace);
  console.log(list);
  return (
    <Container>
      {list.length !== 0 && (
        <Ul>
          {list.map((v) => {
            return <Li>{v.place_name}</Li>;
          })}
        </Ul>
      )}
    </Container>
  );
};

export default FoodList;

const Container = styled.div`
  width: 100%;
`;

const Ul = styled.ul``;
const Li = styled.li`
  padding: 4px;
  margin: 4px;
  background: white;
`;
